_defaults:
  definitions: &definitions_defaults
    _type: ''
    argc: 0
    doc: ''
    doc_group: ''
    exclude: []
    requires: []
  options: &options_defaults
    doc: ''
    vals: []
  packages: &packages_defaults
    exclude: []
options:
  +maths:
    <<: *options_defaults
    doc: Use all maths commands.
  +maths.arrows:
    <<: *options_defaults
    doc: Use mathematical arrows commands.
  +maths.categories:
    <<: *options_defaults
    doc: Use category theory commands.
  +maths.characterAccents:
    <<: *options_defaults
    doc: Use mathematical character accent commands.
  +maths.characterStyles:
    <<: *options_defaults
    doc: Use mathematical character styles commands.
  +maths.misc:
    <<: *options_defaults
    doc: Use mathematical miscallenous commands.
  +maths.operators:
    <<: *options_defaults
    doc: Use mathematical operators commands.
  +maths.theoremEnvs:
    <<: *options_defaults
    doc: Use theorem environments.
  +stix:
    <<: *options_defaults
    doc: Use `stix`.
  +tikz:
    <<: *options_defaults
    doc: Use `tikz`.
  +xecjk:
    <<: *options_defaults
    doc: Use `xecjk`.
  -autopackages:
    <<: *options_defaults
    doc: Tells `kappak` to not automatically include packages.
  -maths.theoremStyles:
    <<: *options_defaults
    doc: Do not use theorem styles for theorem environments.
  -misc:
    <<: *options_defaults
    doc: Do not use `kappak` miscallenous commands.
  alpha:
    <<: *options_defaults
    doc: Do not use.
  bbStyle:
    <<: *options_defaults
    doc: Sets the mathematical blackboard letter style.
    vals:
    - normal
    - bbold
  bellatrix:
    <<: *options_defaults
    doc: Do not use.
  bibliographyStyle:
    <<: *options_defaults
    doc: Sets the bibliography style. Only relevant if you use `kdocument` instead
      of the standard `document` environment.
    vals:
    - _any bibliograph style_
  categoryStyle:
    <<: *options_defaults
    doc: Sets the category style for category theory.
    vals:
    - script
    - allscript
    - bf
    - rm
    - sf
    - tt
  chapterStyle:
    <<: *options_defaults
    doc: Sets the chapter style.
    vals:
    - normal
    - cb
    - rb
  cortana:
    <<: *options_defaults
    doc: Do not use.
  durotan:
    <<: *options_defaults
    doc: Do not use.
  eientei:
    <<: *options_defaults
    doc: Mandatory.
  fontSet:
    <<: *options_defaults
    doc: Sets the font set.
    vals:
    - normal
    - alternate
    - xcharter
  headerFooterStyle:
    <<: *options_defaults
    doc: Sets the header and footer style.
    vals:
    - normal
    - classic
    - cb
    - empty
  language:
    <<: *options_defaults
    doc: Sets the language of the document.
    vals:
    - english
    - french
  lineSpacing:
    <<: *options_defaults
    doc: Sets the line spacing.
    vals:
    - _any numerical value_
  margins:
    <<: *options_defaults
    doc: Sets the margins.
    vals:
    - normal
    - reduced
    - minimal
  numberTheoremsWithin:
    <<: *options_defaults
    doc: What counter theorems should be numbered from.
    vals:
    - _any counter, defaults to section_
  scriptStyle:
    <<: *options_defaults
    doc: Sets the mathematical script style.
    vals:
    - normal
    - euler
    - rsfs
  tikz.externalize:
    <<: *options_defaults
    doc: (EXPERIMENTAL) Use `tikz` compilation cache.
  titlePageStyle:
    <<: *options_defaults
    doc: Sets the title page style.
    vals:
    - normal
    - classic
    - bar
    - gm
    - gb
  version:
    <<: *options_defaults
    doc: Do not use.
    vals:
    - _any version number_
